        width: Dimensions.get('screen').width * 0.4,
        alignItems: 'center',
        borderRadius: 10,
        marginTop: 10,
        marginBottom: 10,
        marginLeft: 4

    },
    EditCrud: {
        backgroundColor: '#6336C2',
        padding: 15,
        width: Dimensions.get('screen').width * 0.4,
        alignItems: 'center',
        borderRadius: 10,
        marginTop: 10,
        marginBottom: 10,
        marginRight: 4
    },
    textCreateButton: {
        color: 'white'
    },
    image: {
        flex: 1,
        resizeMode: 'cover',
        width: Dimensions.get('screen').width * 1,
        alignItems: 'center'

    },
    doc: {
        width: 80,
        height: 80,
        borderRadius: 40
    },
    contdoc: {
        flexDirection: "row"
    },
    contdoc1: {
        flexDirection: "column",
        marginTop: 80,
        marginLeft: 100,
        width: Dimensions.get('screen').width * 0.55,
        backgroundColor: "#FADADA",
        borderRadius: 10,
        alignItems: 'center',
        justifyContent: 'center'

    },
    textdoc: {
        backgroundColor: "#FADADA",
        alignItems: 'center',
        justifyContent: 'center',
        borderRadius: 10,
        marginRight: 10


    }
});

export default DetailProducts;
